	<p>–ü—Ä–∏ —Ä–∞–∑—Ä–∞–±–æ—Ç–∫–µ –ø–ª–∞–Ω–∞ –æ—Ñ–æ—Ä–º–ª–µ–Ω–∏—è –∫–æ—Ç—Ç–µ–¥–∂–∞ –Ω—É–∂–Ω–æ –ø–æ–¥—É–º–∞—Ç—å –æ–± –æ–±—â–µ–º —Å—Ç–∏–ª–µ. –î–æ–∫—É–º–µ–Ω—Ç—ã –†–ö–§. –ü–∏—Ç–æ–º–Ω–∏–∫ –ì–µ—Ä–º–∏–æ–Ω–∞ –ê–Ω–∞–ø–∞ –æ—Ç–µ–ª—å "–ù–µ–≤–∞" –æ–ø–∏—Å–∞–Ω–∏–µ, —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ–∏–∏ , —Ñ–æ—Ä–º–∞ –∑–∞–∫–∞–∑–∞.</p><a id='w4'></a><h3>Account Options</h3><p>–î–∂–µ–º–µ—Ç–µ –æ—Ç–µ–ª—å "–í–∞–ª–µ–Ω—Å–∏—è". –ê–Ω–∞–ø–∞ –ø. –í–∏—Ç—è–∑–µ–≤–æ –æ—Ç–µ–ª—å "–ü–æ–Ω—Ç–æ—Å" —Ñ–æ—Ç–æ–≥—Ä–∞—Ñ–∏–∏, –æ–ø–∏—Å–∞–Ω–∏–µ, –ø–æ—Ä—è–¥–æ–∫ –±—Ä–æ–Ω–∏—Ä–æ–≤–∞–Ω–∏—è, —Ü–µ–Ω—ã. –í–∏—Ç—è–∑–µ–≤–æ –æ—Ç–µ–ª—å "–ú–µ—Ä–∏–¥–∏–∞–Ω". –†—É—Å—Å–∫–∏–π –æ–±—Ä–∞–∑. –í–µ—Ä–Ω—ã–π —Ä–∞–±–æ—Ç—è–≥–∞, –ø—Ä–∏–Ω–æ—Å—è—â–∏–π –¥–µ–Ω—å–≥–∏! –í–∏—Å–∫–∏, –≤–æ–¥–∫–∞, –≥—Ä–∞–ø–ø–∞, –¥–∂–∏–Ω –î–∂–µ–º–µ—Ç–µ –ø–∞–Ω—Å–∏–æ–Ω–∞—Ç "–°–æ–ª–Ω–µ—á–Ω—ã–π". –ü—Ä–æ–¥–∞–∂–∞ –≥–∞–∑–æ–≤–æ–≥–æ –æ–±–æ—Ä—É–¥–æ–≤–∞–Ω–∏—è –≤ –≥. –ö–æ—Ç–µ–ª—å–Ω–∏–∫–æ–≤–æ –í–æ–ª–≥–æ–≥—Ä–∞–¥—Å–∫–æ–π –æ–±–ª–∞—Å—Ç–∏ –ü—Ä–æ–¥–∞–∂–∞ –≥–∞–∑–æ–≤–æ–≥–æ –æ–±–æ—Ä—É–¥–æ–≤–∞–Ω–∏—è –≤ –≥. –ù–æ–≤–æ–∞–Ω–Ω–µ–Ω—Å–∫–∏–π –í–æ–ª–≥–æ–≥—Ä–∞–¥—Å–∫–æ–π –æ–±–ª–∞—Å—Ç–∏ –í—ã–∫—É–ø –±–∏—Ç—ã—Ö –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π –≤ –í–æ–ª–≥–æ–≥—Ä–∞–¥–µ –ë—É–ª—å–¥–æ–∑–µ—Ä—ã, —Ç—Ä—É–±–æ—É–∫–ª–∞–¥—á–∏–∫–∏, –∫–æ–ª–µ—Å–Ω–∞—è —Ç–µ—Ö–Ω–∏–∫–∞ - –Ω–∞ PA RU –ü—Ä–æ–¥–∞–∂–∞ –≥–∞–∑–æ–≤–æ–≥–æ –æ–±–æ—Ä—É–¥–æ–≤–∞–Ω–∏—è –≤ –≥. –ü—Ä–æ–¥–∞–∂–∞ –∑–∞–ø—á–∞—Å—Ç–µ–π. –ö–∞—Ç–∞–ª–æ–≥ —Å —Ç–µ–º–∞—Ç–∏—á–µ—Å–∫–∏–º —Ä—É–±—Ä–∏–∫–∞—Ç–æ—Ä–æ–º.</p>
<p>–¢–µ–º–∞—Ç–∏—á–µ—Å–∫–∏–π –∫–∞—Ç–∞–ª–æ–≥ —Å–∞–π—Ç–æ–≤ "–¢–æ–≤–∞—Ä—ã –∏ —É—Å–ª—É–≥–∏" –ö–∞—Ç–∞–ª–æ–≥ –≤–µ–±-—Å–∞–π—Ç–æ–≤ –†—É–Ω–µ—Ç–∞ –ö–∞—Ç–∞–ª–æ–≥ –≤–µ–±-—Å–∞–π—Ç–æ–≤ –†—É–Ω–µ—Ç–∞ –ò–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è –æ –≤–µ–±-—Å–∞–π—Ç–∞—Ö –°–æ—Ü–∏–∞–ª—å–Ω–∞—è —Å–µ—Ç—å –Ω–µ—Ñ—Ç—è–Ω–∏–∫–æ–≤ –Æ–≥—Ä—ã JVC - —Å–∏—Å—Ç–µ–º—ã –≤–∏–¥–µ–æ–Ω–∞–±–ª—é–¥–µ–Ω–∏—è CCTV –°–∞–π—Ç –æ–± –æ–±–æ—Ä—É–¥–æ–≤–∞–Ω–∏–µ JVC Professional –¥–ª—è —Å–∏—Å—Ç–µ–º—ã –≤–∏–¥–µ–æ–Ω–∞–±–ª—é–¥–µ–Ω–∏—è CCTV —Ä–∞–∑–ª–∏—á–Ω—ã—Ö –æ–±—ä–µ–∫—Ç–æ–≤ - –∫–∞–º–µ—Ä—ã –≤–∏–¥–µ–æ–Ω–∞–±–ª—é–¥–µ–Ω–∏—è –∏ —Å–ª–µ–∂–µ–Ω–∏—è, –∫—É–ø–æ–ª—å–Ω—ã–µ –≤–∏–¥–µ–æ–∫–∞–º–µ—Ä—ã, ip –∫–∞–º–µ—Ä—ã –Ω–∞–±–ª—é–¥–µ–Ω–∏—è, —Ü–∏—Ñ—Ä–æ–≤—ã–µ –≤–∏–¥–µ–æ—Ä–µ–≥–∏—Å—Ç—Ä–∞—Ç–æ—Ä—ã, —Å–µ—Ç–µ–≤—ã–µ –≤–∏–¥–µ–æ—Å–µ—Ä–≤–µ—Ä—ã, –ø—Ä–æ—Ñ–µ—Å—Å–∏–æ–Ω–∞–ª—å–Ω—ã–µ –º–æ–Ω–∏—Ç–æ—Ä—ã –¥–ª—è –≤–∏–¥–µ–æ–Ω–∞–±–ª—é–¥–µ–Ω–∏—è, –∫—É–ø–æ–ª—å–Ω—ã–µ –∫–∞–º–µ—Ä—ã, —Å–ø–µ—Ü–≤–∏–¥–µ–æ–º–∞–≥–Ω–∏—Ç–æ—Ñ–æ–Ω—ã.</p>
